import { BrowserRouter, Route, Routes } from 'react-router-dom';
import React from 'react';
import ResponsiveAppBar from './components/Navbar';
import LoginForm from './components/login';
import DashboardPage from './components/dashboard';
import './App.css';
import AddStudentForm from './components/add-student';
import Home from './components/home';
import Contact from './components/contact';
import GetPersonByIdForm from './components/view-student';
import About from './components/about';
import PersonDetailsPage from './components/PersonDetailsPage';
import UploadCertificatesForm from './components/upload-certificates';


function App() {
  return (
    <BrowserRouter>
      <ResponsiveAppBar />
      <Routes>
        <Route path='/' element={<Home />} />
        <Route path='/about' element={<About />} />
        <Route path='/contact' element={<Contact />} />
        <Route path="/login" element={<LoginForm />} />
        <Route path='/view-student' element={<GetPersonByIdForm/>}/>
        <Route path="/dashboard" element={<DashboardPage />} />
        <Route path='/add-student' element={<AddStudentForm/>}/>
        <Route path='/upload-certificates' element={<UploadCertificatesForm />}/>
        <Route path="/person/:id" element={<PersonDetailsPage />} />

      </Routes>
    </BrowserRouter>
  );
}
export default App;
